import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./app";

import ImgUploader from "./service/img_uploader";
const imgUploader = new ImgUploader();

ReactDOM.render(
  <React.StrictMode>
    <App imgUploader={imgUploader} />
  </React.StrictMode>,
  document.getElementById("root")
);
